const strNestedSpace = cc.debug( "...." );

function nestedSpace( cnt ) {
    let s = "";
    for( let i = 0; i < cnt; ++i )
        s += strNestedSpace;
    return s;
}

function zeroPad( num, places ) {
    const zero = places - num.toString().length + 1;
    return Array( +( zero > 0 && zero ) ).join( "0" ) + num;
}

function s2b( s ) {
    if( ! s )
        return false;
    switch ( s.toString().toLowerCase().trim() ) {
    case "true":
    case "t":
    case "yes":
    case "y":
    case "on":
    case "1":
    case "2":
    case "3":
    case "4":
    case "5":
    case "6":
    case "7":
    case "8":
    case "9":
        return true;
    case "false":
    case "f":
    case "not":
    case "no":
    case "n":
    case "off":
    case "0":
    case null:
        return false;
    default:
        return Boolean( s );
    }
}

log.write( cc.info( "Multi node infrastructure initializer app" ) + cc.debug( ", will initialize " ) + cc.bright( cntNodes ) + cc.debug( " node(s)" ) + "\n" );
