function parse_int_auto( s ) {
    s = s.toString().trim().toLowerCase();
    const radix = ( s.length >= 2 && s[0] == "0" && s[1] == "x" ) ? 16 : 10;
    if( radix == 16 )
        s = s.substring( 2, s.length );
    return parseInt( s, radix );
}

function int_to_hex_string_value_auto( s ) {
    return "0x" + parse_int_auto( s ).toString( 16 );
}

