const baseNodeID = 1112,
    stepNodeID = 1;
const baseNodePort = 2161,
    stepNodePort = 100;
const infoPortShift = 16000;
const ip6PortShift = 50;

function calc_node_id( idxChain, idxNode ) { // idxNode is 0-based
    return idxChain * cntNodes + baseNodeID + idxNode * stepNodeID;
}

function calc_node_ip4( idxChain, idxNode ) { // idxNode is 0-based
    const idx1 = idxNode + 1; // idx1 is 1-based
    return "127.0.0." + ( idxChain * cntNodes + idx1 );
}

function calc_node_port( strProtocol, ipVer, strType, idxChain, idxNode ) { // idxNode is 0-based
    let nPort = idxChain * cntNodes * stepNodePort + baseNodePort + idxNode * stepNodePort;
    switch ( strProtocol ) {
    case "base":
        break;
    case "http":
        nPort += 3;
        break;
    case "https":
        nPort += 8;
        break;
    case "ws":
        nPort += 2;
        break;
    case "wss":
        nPort += 7;
        break;
    default:
        throw new Error( "Cannot calculate node port for unknown protocol \"" + strProtocol + "\"" );
    } //switch( strProtocol )
    switch ( strType ) {
    case "default":
        break;
    case "info":
        nPort += infoPortShift;
        break;
    default:
        throw new Error( "Cannot calculate node port for unknown type \"" + strType + "\"" );
    } //switch( strType )
    switch ( ipVer ) {
    case 4:
        break;
    case 6:
        nPort += ip6PortShift;
        // if( strProtocol == "ws" || strProtocol == "wss" )
        //     nPort += 20;
        break;
    default:
        throw new Error( "Cannot calculate node port for unknown IP version \"" + ipVer + "\"" );
    } //switch( ipVer )
    return nPort;
}

