const strTemplatesDirectory = path.join( __dirname, "templates" );

function copy_template_file( idxChain, idxNode, strTemplateFileName, strNodeFolder, isExecutable ) {
    if( isExecutable === undefined )
        isExecutable = true;
    const srcPath = path.join( strTemplatesDirectory, strTemplateFileName );
    const dstPath = path.join( strNodeFolder, strTemplateFileName );
    let s = fs.readFileSync( srcPath, "utf8" );
    //console.log(s);
    let i = 0;
    const cnt = 20;
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%NODE_IDX%%", "" + idxNode );
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%NODE_ID%%", "" + calc_node_id( idxChain, idxNode ) );
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%NODE_IP4%%", "" + calc_node_ip4( idxChain, idxNode ) );
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%NODE_PORT%%", "" + calc_node_port( "base", 4, "default", idxChain, idxNode ) );
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%PROXY_PORT%%", "" + calc_node_port( "http", 4, "default", idxChain, idxNode ) );
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%PROXY_PORT_S%%", "" + calc_node_port( "https", 4, "default", idxChain, idxNode ) );
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%PROXY_PORT_WS%%", "" + calc_node_port( "ws", 4, "default", idxChain, idxNode ) );
    for( i = 0; i < cnt; ++ i )
        s = s.replace( "%%PROXY_PORT_WSS%%", "" + calc_node_port( "wss", 4, "default", idxChain, idxNode ) );
    fs.writeFileSync( dstPath, s );
    if( isExecutable )
        fs.chmodSync( dstPath, "0777" );
}

